import React, { useEffect,useState} from "react";

export default function PoisList(props){

    return(
        <>
            <div className="card" style={{width: "20%"}}>
            <div class="list-group w-100" style={{margin:"0"}}>
                    <div className="list-group-item gray-400 d-flex justify-content-between align-items-center ">My items : <button class="btn btn-sm btn-secondary" onClick={props.addItem}>+</button></div>
                    {props.pois.map(d => (
                        <button class="list-group-item list-group-item-action" aria-current="true"><div className="list-group-item d-flex justify-content-between align-items-center " style={{borderWidth:"0", backgroundColor:"transparent"}}>{d.name}</div></button>
                    ))}
                </div>
            </div>
        </>
    );
}
